import React, { useState, useEffect } from "react";
import { useParams, useHistory } from "react-router-dom";

export const path = "/teams/edit/:id";
export const pathToCreate = "/teams/edit";

export default function EditTeam() {

    const { id } = useParams();
    const [team, setTeam] = useState();
    const history = useHistory();

    const isEdit = !!id;

    useEffect(() => {

        function handleFetchedData(err, data) {
            if (err) throw err;
            setTeam(data);
        }

        if (isEdit) {
            const detail = {
                path: decodeURIComponent(id),
                callback: handleFetchedData
            };
            document.dispatchEvent(new CustomEvent("fetch-object", { detail }));
        }
    });

    function handleStored(err) {
        if (err) throw err;
        history.goBack();
    }

    function handleFormSubmit(e) {

        e.preventDefault();
        const form = e.target;
        const formData = new FormData(form);
        const data = Object.fromEntries(formData.entries());
        const detail = {
            data: { ...data, id: id && decodeURIComponent(id), "@type": "Team" },
            callback: handleStored
        };
        document.dispatchEvent(new CustomEvent("store-object", { detail }));

    }

    return <>
        <h1>{isEdit ? "Edit" : "New"} team</h1>
        <form onSubmit={handleFormSubmit}>
            <label>
                <span>Name</span>
                <input type="text" defaultValue={team?.name} name="name"></input>
            </label>

            <label>
                <span>Team logo</span>
                <input type="text" defaultValue={team?.img} name="img" id="etimg"></input>
            </label>

            <button>{isEdit ? "Save" : "Create"}</button>
        </form>

        <button className="image-button" type="button" onClick={() => document.querySelector("#etimg").value = heavyData}>
            <img alt="heavy" src={heavyData} />
        </button>
        <button className="image-button" type="button" onClick={() => document.querySelector("#etimg").value = lightData}>
            <img alt="light" src={lightData} />
        </button>

    </>;
}


const heavyData = "data:image/jpeg;base64,";
const lightData = "data:image/jpeg;base64,";